class AchievementsComponent {
    constructor(http, achievementService, tokenStorage, pictureService) {
        this.http = http;
        this.achievementService = achievementService;
        this.tokenStorage = tokenStorage;
        this.achievements = [];
        this.pageNumber = 0;
        this.isLastPage = false;
        this.form = {};
        this.failed = false;
        this.errorMessage = '';
        this.fileToUpload = null;
        this.pictureService = pictureService;
    }
    ngOnInit() {
        this.getAchievements();
        this.checkAuth();
    }
    getAchievements() {
        this.achievementService.getAchievements(this.pageNumber).subscribe(
        // tslint:disable-next-line:prefer-const
        (res) => {
            let data = res;
            data.content.forEach((element) => {
                this.achievements.push(element);
            });
            this.pageNumber++;
            this.isLastPage = data.last;
        }, (err) => {
            alert("get error");
        });
    }
    sortby(date) {
        return this.achievements.sort((a, b) => a[date] < b[date] ? 1 : a[date] === b[date] ? 0 : -1);
    }
    onDeleteAchievement(a) {
        this.achievements = this.achievements.filter(rowObj => rowObj.id !== a.id);
    }
    //post
    onSubmit(empForm) {
        this.uploadFileToActivity();
        const o = {
            title_hu: this.form.title,
            location_hu: this.form.location,
            title_en: this.form.title,
            location_en: this.form.location,
            date: this.form.date,
            description_hu: 'tempdata',
            description_en: 'tempdata',
            place: this.form.place,
            isLast: false,
            picture: '../../assets/achievement/' + this.fileToUpload.name
        };
        const b = this.http
            .post("http://localhost:8080/api/achievement", o)
            .subscribe((data) => {
            console.log(data);
        });
        this.pushAchievement();
        this.form = empForm;
        this.form.reset();
        this.fileToUpload = null;
    }
    handleFileInput(files) {
        this.fileToUpload = files.item(0);
    }
    uploadFileToActivity() {
        this.pictureService.postFile(this.fileToUpload, 'achievement').subscribe(data => {
            // do something, if upload success
        }, error => {
            console.log(error);
        });
    }
    pushAchievement() {
        let n;
        if (this.fileToUpload != null) {
            n = {
                id: 0,
                title_hu: this.form.title,
                location_hu: this.form.location,
                title_en: this.form.title,
                location_en: this.form.location,
                description_hu: 'thrnrnre',
                description_en: 'trnrntr',
                place: this.form.place,
                isLast: false,
                date: this.form.date,
                picture: '../../assets/achievement/' + this.fileToUpload.name
            };
        }
        else {
            n = {
                id: 0,
                title_hu: this.form.title,
                location_hu: this.form.location,
                title_en: this.form.title,
                location_en: this.form.location,
                description_hu: 'trenren',
                description_en: 'brngrn',
                place: this.form.place,
                isLast: false,
                date: this.form.date,
                picture: ''
            };
        }
        this.achievements.unshift(n);
    }
    checkAuth() {
        this.authority = undefined;
        if (this.tokenStorage.getToken()) {
            let roles = this.tokenStorage.getAuthorities();
            roles.every((role) => {
                if (role === "ROLE_ADMIN") {
                    this.authority = "admin";
                    return false;
                }
                this.authority = "user";
                return true;
            });
        }
    }
}
